import React from "react";
import "./index.css"
import {Link} from "react-router-dom";

const HeaderTable = ({ code, number }) => {
    return (
        <div className="headerTable">
            <h2>
                {number}
                <Link to="/loop2">
                    <button>2</button>
                </Link>
            </h2>
            <pre>
                {code}
            </pre>
        </div>
    )
}

export default HeaderTable;
